DROP TABLE IF EXISTS `escuelas`;
CREATE TABLE `escuelas` (
  `cod` smallint(3) unsigned NOT NULL default '0',
  `escuela` int(4) unsigned NOT NULL default '0',
  `nombre` char(100) NOT NULL default '',
  `jornada` char(3) NOT NULL default '',
  `modalidad` char(170) NOT NULL default '',
  `orientacion` char(176) NOT NULL default '',
  `perlectivo` char(3) NOT NULL default '',
  `ambito` char(6) NOT NULL default '',
  `localidad` char(30) NOT NULL default '',
  `loc_ID` int(3) unsigned NOT NULL default '0',
  `depto` tinyint(3) unsigned NOT NULL default '0',
  `categoria` tinyint(3) unsigned NOT NULL default '0',
  `grupo` char(3) NOT NULL default '',
  `direccion` char(120) NOT NULL default '',
  `telefono` char(26) NOT NULL default '',
  `telred` char(7) NOT NULL default '',
  `biblioteca` char(1) NOT NULL default '',
  `cooperadora` char(16) NOT NULL default '',
  `resolucion` char(35) NOT NULL default '',
  `fecha_creacion` date NOT NULL default '0000-00-00',
  `padrino` char(100) NOT NULL default '',
  `cue` int(10) unsigned NOT NULL default '0',
  `email` char(30) NOT NULL default '',
  PRIMARY KEY  (`escuela`),
  KEY `localidad` (`localidad`)
) TYPE=MyISAM;
